import React from 'react';

function BookCard(props) {
  return (
    <>
      <div>{props.title}</div>
      <div>{props.authors}</div>
      <div>{props.description}</div>
      <div>{props.image}</div>
      <div>{props.link}</div>
      <div>{props.email}</div>
      <hr></hr>
    </>
  );
}

export default BookCard;
